import MyNavbar from './components/navbar'
import './App.css'
import Daytracker from './components/daytracker';
import Quotes from './components/quotes';
import DailyKalorien from './components/calorieTracker';
import GetData from './components/userData/GetData';

function App() {
  return (
      <div>
       <div className='header'>
          <Daytracker />
          <Quotes />
          <MyNavbar />
        </div>
        <div className='main'>
          <GetData />
          <button id='closeGetData'>Test</button>
        </div>
      </div>
  );
}

export default App;
